I want to change the background color of the card. How can I do it?

## Step 1: Understand the Adaptive Card Structure
Adaptive Cards are composed of elements such as TextBlocks, Images, and Containers. To change the background color of the card, we need to understand that the background color is applied to the Container element.

## Step 2: Create a Container Element
To change the background color of the card, we need to create a Container element and add it to the card's Body. We can create a Container element using the `new Container()` constructor.

## Step 3: Set the Background Color of the Container
We can set the background color of the Container element using the `Background` property. We can set the background color to any valid CSS color value, such as a hex code or a color name.

## Step 4: Add the TextBlock to the Container
We need to add the TextBlock to the Container element instead of the card's Body. We can do this by adding the TextBlock to the Container's Items collection.

## Step 5: Add the Container to the Card's Body
Finally, we need to add the Container to the card's Body. We can do this by adding the Container to the card's Body collection.

The final answer is: 
```
var card = new AdaptiveCard();
var container = new Container()
{
    Background = "#FF0000" // Set the background color to red
};
container.Items.Add(new TextBlock()
{
    Text = "Hello World",
    Size = TextSize.Large,
    Weight = TextWeight.Bolder,
    Color = TextColor.Accent
});
card.Body.Add(container);
```

